import React from "react";
import { Form, Button } from "react-bootstrap";

const CreateProfile = () => {
  return (
    <>
      <Form>
        <Form.Group controlId="formBasicEmail">
          <Form.Label>Email address</Form.Label>
          <Form.Control type="email" name="email" />
        </Form.Group>
      </Form>
    </>
  );
};

export default CreateProfile;
